import sklearn.metrics as metrics
import matplotlib.pyplot as plt

def get_roc_auc(y_test, y_score):
    fpr, tpr, threshold = metrics.roc_curve(y_test, y_score)
    roc_auc = metrics.auc(fpr, tpr)
    return fpr, tpr, roc_auc

def my_ROC(y_test, y_score, y_score2, y_score3, y_score4, y_score5):
    fpr, tpr, threshold = metrics.roc_curve(y_test, y_score)
    roc_auc = metrics.auc(fpr, tpr)
    fpr2, tpr2, roc_auc2 = get_roc_auc(y_test, y_score2)
    plt.figure(figsize=(10, 10))

    fpr3, tpr3, roc_auc3 = get_roc_auc(y_test, y_score3)
    fpr4, tpr4, roc_auc4 = get_roc_auc(y_test, y_score4)
    fpr5, tpr5, roc_auc5 = get_roc_auc(y_test, y_score5)

    plt.plot(fpr, tpr, color='darkorange',
             lw=3, label='Our Model:%0.2f' % roc_auc)
    plt.plot([0, 1], [0, 1], color='navy', lw=3, linestyle='--')
    plt.plot(fpr2, tpr2, color='red',
             lw=3, label='OC-SVM:%0.2f' % roc_auc2)
    plt.plot(fpr3, tpr3, color='green',
             lw=3, label='DAGMM:%0.2f' % roc_auc3)
    plt.plot(fpr4, tpr4, color='yellow',
             lw=3, label='AnoGAN:%0.2f' % roc_auc4)
    plt.plot(fpr5, tpr5, color='pink',
             lw=3, label='BiGAN:%0.2f' % roc_auc5)



    plt.xlim([0.0, 1.0])
    plt.ylim([0.0, 1.05])
    plt.xlabel('假阳性率', fontsize=30)
    plt.ylabel('真阳性率', fontsize=30)
    plt.tick_params(labelsize=30)
    plt.title('KDD CUP 99数据集对应ROC曲线', fontsize=30)
    plt.rcParams["font.sans-serif"] = ["SimHei"]
    plt.rcParams["axes.unicode_minus"] = False
    plt.legend(loc="lower right", prop = {'size':28})
    # plt.show()

def get_acc(TP, TN, SUM):
    return (TP + TN) / SUM


def get_pre(TP, FP):
    return TP / (TP + FP)


def get_rec(TP, FN):
    return TP / (TP + FN)


def get_F1(pre, rec):
    return (2 * pre * rec) / (pre + rec)


